import React from 'react'
import './css/buttons.css'



const Buttonoffices = () =>{
  return (
    <div className='Offices'>
        <button2>
            Offices
        </button2>
    </div>
  )
}
const Buttonpeople = () =>{
  return (
    <div className='People'>
        <button3>
            People
        </button3>
    </div>
  )
}

const Buttonjobs = () =>{
  return (
    <div className='Jobs'>
        <button4>
            Jobs
        </button4>
    </div>
  )
}
const Buttondir = () =>{
  return (
    <div className='Directory'>
        <button5>
            Directories
        </button5>
    </div>
  )
}
  const Buttonabout = () =>{
    return (
      <div className='AboutMKE'>
          <button6>
              AboutMKE
          </button6>
      </div>
    )
  }


const Buttonne = () =>{
  return (
    <div className='NewsEvents'>
        <button7>
            News/Events
        </button7>
    </div>
  )
}   
 const Buttontransportation = () =>{
      return (
        <div className='Transportation'>
            <button8>
                Transportation
            </button8>
        </div>
      )
}
const Buttonreturndir = () =>{
  return (
    <div className='Returndir'>
        <button9>
            Return
        </button9>
    </div>
  )
}
export{
    
  Buttonoffices,
  Buttonpeople,
    Buttonjobs,
    Buttondir,
    Buttonabout,
    Buttonne,
    Buttontransportation,
    Buttonreturndir
}
